import React from "react";

function Timeline(props) {
  let chirps = props.chirps.map(chirp => {
    return (
      <div className="container">
        <p key={chirp.chirpId}>{chirp.chirpContent}</p>
      </div>
    );
  });
  return chirps;
}

export default Timeline;
